import React from 'react';
import './Home.css'
import Kaibot from '../Kaibot.png'

function Home() {
  return (
    <div className='home'>
      <img src={Kaibot} className='Img'></img>
      <h4 className='Desc'>카이봇은 서버관리, 노래, 검색,<br></br> 인공지능 등 여러가지 기능을<br></br> 보유하고 있는 강력한 디스코드 봇 입니다.</h4>
      <a href='https://discord.com/oauth2/authorize?client_id=775542914117795860&permissions=8&scope=bot' target='_blank'>
        <button className='invite'>
          초대하기
        </button>
      </a>
      <a href='/commands'>
        <button className='commands'>
          명령어들
        </button>
      </a>
    </div >
  );
}

export default Home;
